from typing import List


class Solution:
    def threeSum(self, nums: List[int]) -> List[List[int]]:
        nums.sort()
        if not nums or len(nums) < 3:
            return []
        
        self.memo = {}
        res = []
        for i, a in enumerate(nums):
            if i > 1 and nums[i] == nums[i-1]:
                continue
            bc = self.twoSum(nums[:i]+nums[i+1:], -a)
            if bc:
                res.extend([[a]+item for item in bc])
        return {tuple(sorted(item)) for item in res}
        
    
    def twoSum(self, nums: List[int], target) -> List[List[int]]:
        if not nums or len(nums) < 2:
            return []
        
        hash = str(target) + str(nums)
        if hash in self.memo:
            return self.memo[hash]
        d = {}
        res = []
        for i, a in enumerate(nums):
            wanted = target-a
            if wanted in d:
                 res.append([nums[i], nums[d[wanted]]])
            else:
                d[a] = i
        self.memo[hash] = res
        return res

